"use strict";(self.webpackChunkproval_docs=self.webpackChunkproval_docs||[]).push([[70167],{517352:e=>{e.exports=JSON.parse('{"tag":{"label":"Logging","permalink":"/proval-docs/docs/tags/logging","description":"Documents related to log management and analysis for systems","allTagsPath":"/proval-docs/docs/tags","count":40,"items":[{"id":"cwa/scripts/7d8df295-577a-4c61-934b-341fcbb37784","title":"Add-AzureVPNConnection Paranet(Compassus)","description":"This document provides a detailed guide on setting up the Compassus Azure VPN connection for all users, including sample runs, variable documentation, and the necessary steps to execute the script successfully.","permalink":"/proval-docs/docs/cwa/scripts/7d8df295-577a-4c61-934b-341fcbb37784"},{"id":"cwa/scripts/581b4986-28e0-41df-bff8-c5179414c9ee","title":"Agent Monitors - Remove Disk Monitors for Missing Drives","description":"This document outlines a script designed to clean up older remote drive space monitors for non-existent drives on Windows systems. It provides guidance on when to run the script, including examples of error messages and monitors that indicate the need for cleanup. The process of the script and its output are also detailed.","permalink":"/proval-docs/docs/cwa/scripts/581b4986-28e0-41df-bff8-c5179414c9ee"},{"id":"cwa/scripts/1d5d4aff-3a10-4bef-8e29-5e3234a1076b","title":"Automate Database Maintenance - Roles","description":"This document details a script designed for the Automate Database Maintenance Solution, focusing on the cleanup of specific database tables, particularly ComputerRoleDefinitions. It includes information on variable usage, expected outcomes, and logging procedures.","permalink":"/proval-docs/docs/cwa/scripts/1d5d4aff-3a10-4bef-8e29-5e3234a1076b"},{"id":"cwa/scripts/983c0f82-09ce-4570-b7dc-55dfc78678fc","title":"Automate Database Maintenance - UserCentric","description":"This document provides an overview of the Automate Database Maintenance Script, which is designed to handle the cleanup of specific database tables, particularly the Contacts table. It includes details on variable usage, log output, and sample runs to assist users in implementing the script effectively.","permalink":"/proval-docs/docs/cwa/scripts/983c0f82-09ce-4570-b7dc-55dfc78678fc"},{"id":"cwa/scripts/6436e6f3-e161-4b64-a4bf-1177cce2f968","title":"Automate Database Maintenance Solution","description":"This document details the Automate Database Maintenance Solution, a script designed to execute recommended database tasks within ConnectWise Automate. It includes features for logging actions, maintaining database cleanliness, and specific cleanup functions for tickets, drives, commands, and more.","permalink":"/proval-docs/docs/cwa/scripts/6436e6f3-e161-4b64-a4bf-1177cce2f968"},{"id":"vsa/procedures/ee5b1d9e-eabf-4be4-ad8c-6192b5223cbb","title":"Azure AD Status","description":"This document outlines a procedure to check if a machine is Azure AD joined or registered. It details the logging of actions taken during the process and how to update custom fields based on the machine Azure AD status. The procedure is essential for filtering machines in views based on their Azure AD status.","permalink":"/proval-docs/docs/vsa/procedures/ee5b1d9e-eabf-4be4-ad8c-6192b5223cbb"},{"id":"cwa/scripts/aa0c7575-d9f1-4c41-98bb-50eab8aa1ade","title":"Bitlocker - Enable TPM","description":"This document details the implementation of the agnostic script SEC - Encryption - Agnostic - Enable-TPM within Automate. It covers the initialization of the Trusted Platform Module (TPM) as part of the provisioning process, including necessary parameters and expected outputs.","permalink":"/proval-docs/docs/cwa/scripts/aa0c7575-d9f1-4c41-98bb-50eab8aa1ade"},{"id":"cwa/scripts/202e2dde-5865-4035-8410-37dc6cb92a60","title":"BlackPoint - SnapAgent Installer","description":"This document provides a comprehensive guide on the SnapAgent installation script, detailing its dependencies, variables, and ticketing features for efficient deployment and monitoring. It includes sample runs, variable documentation, and logging information to assist in successful implementation.","permalink":"/proval-docs/docs/cwa/scripts/202e2dde-5865-4035-8410-37dc6cb92a60"},{"id":"vsa/procedures/779a0d48-5fcd-4353-a457-14565e602085","title":"Check User - pccomp","description":"This document outlines the procedure for checking the existence of the user \\"pccomp\\" within the system. It includes a summary of the agent procedure logs, dependencies, and the expected output of the procedure.","permalink":"/proval-docs/docs/vsa/procedures/779a0d48-5fcd-4353-a457-14565e602085"},{"id":"cwrmm/tasks/b4921df9-1b7e-439a-80b9-28ca3d58f506","title":"Clear Firefox Cache","description":"This document provides a detailed guide on how to clear the Gecko engine (Firefox) browser caches using a script in ConnectWise RMM. It includes sample runs, task creation steps, and the complete script implementation.","permalink":"/proval-docs/docs/cwrmm/tasks/b4921df9-1b7e-439a-80b9-28ca3d58f506"},{"id":"cwa/scripts/c8638470-bc69-4bc9-ac97-b0496e546d07","title":"CVE-2013-3900 WinVerifyTrust Signature Vulnerability","description":"This document outlines the process for detecting and remediating the CVE-2013-3900 WinVerifyTrust Signature Vulnerability using a specific script. It includes details on dependencies, variables, output, and ticketing procedures necessary for effective management of the vulnerability.","permalink":"/proval-docs/docs/cwa/scripts/c8638470-bc69-4bc9-ac97-b0496e546d07"},{"id":"cwa/scripts/b0bd8d59-9491-4669-8226-fd7df87c722d","title":"CVE-2016-2115 - SMB Signing","description":"This document details a script designed to detect and remediate the CVE-2016-2115 vulnerability related to SMB signing. It includes sample runs, dependencies, variables used in the script, output details, and ticketing procedures for successful remediation.","permalink":"/proval-docs/docs/cwa/scripts/b0bd8d59-9491-4669-8226-fd7df87c722d"},{"id":"cwa/dataviews/08be7213-18a0-4631-b521-1cdcc55ea3a1","title":"CVE-2016-2115 SMB Signing Audit","description":"This document outlines the data gathered from the CWA Script related to CVE-2016-2115, detailing the status of SMB Signing on the deployed agent, including relevant columns and their descriptions.","permalink":"/proval-docs/docs/cwa/dataviews/08be7213-18a0-4631-b521-1cdcc55ea3a1"},{"id":"cwa/scripts/57986a3b-add4-4d2e-9093-078135c9d871","title":"CVE-2016-2183 Birthday Attacks 3DES Cipher Suites Remediation","description":"This document details a script designed to detect and remediate the CVE-2016-2183 Birthday Attacks vulnerability related to 3DES cipher suites. It outlines the required execution settings, dependencies, variables, output, and ticketing processes for effective vulnerability management.","permalink":"/proval-docs/docs/cwa/scripts/57986a3b-add4-4d2e-9093-078135c9d871"},{"id":"cwa/scripts/158a1816-be64-428f-b5fa-f0c6b8b6c1fb","title":"CVE-2021-1675 - Set folder ACL (PrintNightmare)","description":"This document outlines a script that sets permissions for the user \\"System\\" on the C://Windows//System32//Spool//Drivers folder to DENY, aiming to prevent file injection related to CVE-2021-1675. The script also enables event logging for monitoring purposes, providing a comprehensive solution for security enhancement.","permalink":"/proval-docs/docs/cwa/scripts/158a1816-be64-428f-b5fa-f0c6b8b6c1fb"},{"id":"cwa/monitors/e31c7707-d9bc-4410-8ce2-5cc795a283f3","title":"CVE-2021-27065 Detection","description":"This document outlines a remote monitor designed to check the Microsoft Exchange Server for vulnerabilities related to a remote code execution issue identified in March 2021. It details the setup, including suggested limits, alert styles, and the monitoring process using log files.","permalink":"/proval-docs/docs/cwa/monitors/e31c7707-d9bc-4410-8ce2-5cc795a283f3"},{"id":"cwa/scripts/46d40e52-cb07-4f17-a319-37efc6d96445","title":"CVE-2023-32019 Remediation","description":"This document outlines a PowerShell script designed to add registry keys for CVE-2023-32019 remediation on supported Windows operating systems. It includes options for reverting changes and emphasizes the importance of testing the script on a limited number of machines before wider deployment.","permalink":"/proval-docs/docs/cwa/scripts/46d40e52-cb07-4f17-a319-37efc6d96445"},{"id":"cwa/scripts/830beb63-113a-406e-aef2-046403de9cb9","title":"CWM - Automate - ESXi - Snapshot Delete Param","description":"This document provides a comprehensive guide on using a PowerShell script to delete a snapshot of a machine hosted on an ESXi host server utilizing the PowerCLI module. It covers prerequisites, dependencies, user parameters, and alerting mechanisms for successful execution.","permalink":"/proval-docs/docs/cwa/scripts/830beb63-113a-406e-aef2-046403de9cb9"},{"id":"vsa/procedures/5c93252c-c3d9-48d7-bc9b-4073c9e49638","title":"Disable RDP","description":"This document explains a script designed to check if Remote Desktop Protocol (RDP) is enabled on a Windows machine and disable it by modifying the relevant Registry value. It provides a detailed log of actions taken during the execution of the script, along with sample outputs and processes involved.","permalink":"/proval-docs/docs/vsa/procedures/5c93252c-c3d9-48d7-bc9b-4073c9e49638"},{"id":"cwa/scripts/f65ad1a0-8f26-40f7-8d72-0e753243c01e","title":"HP Support Assistant - Install","description":"This document outlines a script that downloads and installs the HP Support Assistant when a user is logged in. It verifies the installation and logs the outcome, aiming to save time by automating the installation process.","permalink":"/proval-docs/docs/cwa/scripts/f65ad1a0-8f26-40f7-8d72-0e753243c01e"},{"id":"vsa/procedures/3d5b37dc-7ea4-4d06-a83d-7acdf91b8e1c","title":"Huntress - Managed EDR - Uninstall","description":"This document outlines the agent procedure for uninstalling the Huntress EDR agent, updater, and related components. It provides a detailed implementation guide, including dependencies, process steps, and output log locations for successful uninstallation.","permalink":"/proval-docs/docs/vsa/procedures/3d5b37dc-7ea4-4d06-a83d-7acdf91b8e1c"},{"id":"cwrmm/tasks/3a0c2a5d-0d46-4c3b-b0a7-bdffd60c6fd2","title":"Huntress Agent (Install) - MAC","description":"This document provides a detailed guide on creating a script to check for the installation of the Huntress agent on MAC machines. If the agent is not installed, the script will attempt to download and install it while logging the results of the operation.","permalink":"/proval-docs/docs/cwrmm/tasks/3a0c2a5d-0d46-4c3b-b0a7-bdffd60c6fd2"},{"id":"cwa/scripts/52d001b4-7152-4616-92de-99a002e2d22c","title":"Hyper-V - Guest VMs - StartStop","description":"This document describes a script that enables the management of virtual machines on a Hyper-V host, allowing users to start or shut down VMs based on previous executions of the script, ultimately saving time in the process.","permalink":"/proval-docs/docs/cwa/scripts/52d001b4-7152-4616-92de-99a002e2d22c"},{"id":"cwrmm/tasks/e90f2a06-b9f8-4a59-bb22-5a2f1102f51f","title":"Install Perch Log Shipper","description":"This document provides a comprehensive guide on deploying Perch Log Shipper on Windows machines, including sample runs, user parameters, task creation steps, and script details.","permalink":"/proval-docs/docs/cwrmm/tasks/e90f2a06-b9f8-4a59-bb22-5a2f1102f51f"},{"id":"cwa/scripts/18a8b802-bc6a-42a8-859b-89c93fed4257","title":"Malicious Software Removal Tool Scanner","description":"This document outlines a script that downloads and executes the latest version of the Microsoft Malicious Software Removal Tool Scanner. It logs the results and sends an email with the outcome to specified addresses, and it also includes an option for automatic infection resolution.","permalink":"/proval-docs/docs/cwa/scripts/18a8b802-bc6a-42a8-859b-89c93fed4257"},{"id":"cwa/scripts/876cdd82-d35f-4112-91d1-806bb5215d19","title":"Monthly SFC Scan","description":"This document provides a detailed overview of a script that performs an SFC scan on Windows systems, handles errors, and manages ticketing based on the scan results. It outlines the process of running the scan, logging results, and executing necessary repairs while maintaining communication through ticket updates.","permalink":"/proval-docs/docs/cwa/scripts/876cdd82-d35f-4112-91d1-806bb5215d19"},{"id":"cwa/scripts/89346170-6657-4784-93cf-c0aa024b4386","title":"PowerShell Response - All Errors - Check","description":"This document details a PowerShell script designed to check for common errors in the output of a parent script. It converts these errors into a human-readable format and logs them, aiding in troubleshooting and development. The script enhances the debugging process by providing clear error messages based on known issues, making it a valuable tool for developers.","permalink":"/proval-docs/docs/cwa/scripts/89346170-6657-4784-93cf-c0aa024b4386"},{"id":"cwa/tables/c62e7bbf-226d-4269-9d12-536e43af5589","title":"pvl_login_logout_audit","description":"This document provides details about the User login/logout data table, including its purpose, dependencies, and the structure of the pvl_login_logout_audit table with descriptions of each column.","permalink":"/proval-docs/docs/cwa/tables/c62e7bbf-226d-4269-9d12-536e43af5589"},{"id":"cwrmm/custom-fields/7876f32c-a5ec-4b58-9f7e-b60b710e19d5","title":"Reboot Prompter","description":"This document outlines the custom fields used in the Reboot Prompter Solution, detailing their properties, default values, and how to create them in the settings. It includes a table of custom fields with descriptions and step-by-step instructions for setup.","permalink":"/proval-docs/docs/cwrmm/custom-fields/7876f32c-a5ec-4b58-9f7e-b60b710e19d5"},{"id":"cwa/scripts/201f46d7-6511-4e5f-a002-ff7f4b27c8be","title":"Remove Application - Network Glue Collector","description":"This document details a script designed for the uninstallation of the Network Glue Collector, either on demand or as part of an offboarding process. It includes dependencies, variables, global parameters, output details, and ticketing information in case of failure during the uninstallation.","permalink":"/proval-docs/docs/cwa/scripts/201f46d7-6511-4e5f-a002-ff7f4b27c8be"},{"id":"cwa/scripts/244750a4-5402-42e9-8436-641adbd91f8c","title":"Remove Xbox Package","description":"This document provides a detailed overview of a script designed to remove all Xbox packages, including the Xbox Game Bar, from a target system. The process involves running a PowerShell script that checks for online provisioned Xbox packages and attempts to remove them, complete with error handling for logging purposes.","permalink":"/proval-docs/docs/cwa/scripts/244750a4-5402-42e9-8436-641adbd91f8c"},{"id":"cwrmm/tasks/ee16e74b-f20e-4917-b025-b565c6556807","title":"Repair Print Spooler","description":"This document provides a detailed guide on using a script to reset the Print Spooler service, check and start necessary dependencies, and log the service status before and after repair. It is aimed at troubleshooting and resolving common issues with the Print Spooler service in a ConnectWise RMM environment.","permalink":"/proval-docs/docs/cwrmm/tasks/ee16e74b-f20e-4917-b025-b565c6556807"},{"id":"cwa/monitors/7665cb82-1340-4f76-ba0e-e7c277c40f73","title":"SMB1 Traffic Detection","description":"This document outlines the SMB1 Server Auditing Remote Monitor, which activates auditing for SMB1 connections and reviews event logs for client connection attempts. It serves to identify environments still using the SMB1 protocol before disabling it.","permalink":"/proval-docs/docs/cwa/monitors/7665cb82-1340-4f76-ba0e-e7c277c40f73"},{"id":"cwa/scripts/4fd2cffe-c41b-4a3c-9b5e-3edb02ad322b","title":"SMBv1 Status AuditAutofix DV,Param","description":"This document outlines a script created to detect and remediate SMBv1 vulnerabilities based on specified settings in the EDF. It details the script execution requirements, dependencies, variables, and output, along with ticketing procedures for successful and failed remediation attempts.","permalink":"/proval-docs/docs/cwa/scripts/4fd2cffe-c41b-4a3c-9b5e-3edb02ad322b"},{"id":"vsa/procedures/016b09a7-6d4c-41bf-a4ec-befc678a5259","title":"Soji - Disk Cleaner","description":"Soji is a Windows disk cleaner designed to log actions to the agent procedure log and upload CSV reports to the target agent\u2019s \\"Get Files\\" section. This document provides a summary, sample run, process details, output expectations, and export attachment instructions for using Soji effectively.","permalink":"/proval-docs/docs/vsa/procedures/016b09a7-6d4c-41bf-a4ec-befc678a5259"},{"id":"cwa/scripts/47f53d1e-f609-46f8-b407-ccdf11eeede4","title":"Soji - Disk Space Management","description":"This document describes the Soji execution script designed for ConnectWise Automate, detailing its functionality, dependencies, user parameters, process steps, and output results. The script facilitates the execution of the Soji application while managing necessary installations and logging outputs effectively.","permalink":"/proval-docs/docs/cwa/scripts/47f53d1e-f609-46f8-b407-ccdf11eeede4"},{"id":"cwa/scripts/63beba3c-f4a6-41a5-98e2-d4e4ce885035","title":"Ticket Creation - Computer","description":"This document provides a comprehensive overview of an all-in-one script designed for monitors that generates detailed tickets with useful information. It is specifically tailored for use in a monitor-driven environment, ensuring efficient ticket creation without manual intervention. The script includes variables for enhanced alert messages and is dependent on the configuration of the monitor\u2019s alerting tab.","permalink":"/proval-docs/docs/cwa/scripts/63beba3c-f4a6-41a5-98e2-d4e4ce885035"},{"id":"cwa/scripts/0ac0139f-9c8e-4ef2-94df-5cf3b1569ecf","title":"Uninstall HP Bloatware","description":"This document outlines a script designed to uninstall all HP bloatware from Windows workstations, detailing its operation, global variables, output, and ticketing system for failures during uninstallation.","permalink":"/proval-docs/docs/cwa/scripts/0ac0139f-9c8e-4ef2-94df-5cf3b1569ecf"},{"id":"cwa/scripts/45074a99-85a8-4e7f-bda4-775697504bad","title":"User Management - Purge Local Account and Profile","description":"This document outlines a script designed to completely remove and purge local accounts, including UserSID, from the agent. It can operate manually or automatically, depending on the configuration. The script saves approximately 5 minutes of time by automating the removal process for inactive accounts.","permalink":"/proval-docs/docs/cwa/scripts/45074a99-85a8-4e7f-bda4-775697504bad"},{"id":"cwa/scripts/611414aa-ae0b-46f3-92e4-4a99a42e6719","title":"Visual Studio Auto Update","description":"This document details a script designed to perform auto updates for various versions of Visual Studio, including 2017, 2019, and 2022 editions. It outlines compatible applications, dependencies, variables used within the script, and provides a sample run for reference.","permalink":"/proval-docs/docs/cwa/scripts/611414aa-ae0b-46f3-92e4-4a99a42e6719"}],"unlisted":false}}')}}]);